import React from 'react';
import logo from './logo.svg';
import './App.css';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

function App() {
  return (
    <Container>
      <Row>
        <Col sm={3}>col1</Col>
        <Col sm={9}>col2</Col>
      </Row>
    </Container>
  );
}

export default App;
